'use strict';
let MessageType = require('./MessageType.js');
let LeverageProfilesList = require('./LeverageProfilesList.js');
class GetLeverageProfilesMessage {
    leverageProfilesList;
    accountId;
    constructor() {
        this.leverageProfilesList = new LeverageProfilesList();
    }
    getLeverageProfiles() {
        return this.leverageProfilesList.toArray();
    }
    getType() {
        return MessageType.GetLeverageProfiles;
    }
    getAccountId() {
        return this.accountId;
    }
}
module.exports = GetLeverageProfilesMessage
